import './App.css';
import { useEffect, useState } from 'react';
import  axios from 'axios';

function App(props) {
	const [base, setBase] = useState([]);
	const [currencies, setCurrencies] = useState([]);
	const [currency, setCurrency] = useState([]);
	const [identifier, setIdentifier] = useState(1);
	const [loading, setLoading] = useState(false);

	const getCurrencies = async () => {
		setLoading(true)
		try {
			let response = await axios.get(`https://api.currencyfreaks.com/latest?apikey=7853f4e1f6094bf492a3213a6ee5e381`)
			setBase(response.data.base);
			setCurrencies(response.data.rates);
			setCurrency([
				{name: 'CAD'},
				{name: 'CAD'},
				{name: 'CAD'},
				{name: 'CAD'},
			])
			setLoading(false)
		} catch(e) {
			setLoading(true)
			console.log(e.message);
		}
	}

	useEffect(() => {
		getCurrencies();
	}, [identifier])



	return (
		<div className='py-5'>
			<div className='container'>
				<div className='row justify-content-center'>
					<div className='col-md-8'>
						<input type='text' name='identifier' value={identifier} onChange={(e) => setIdentifier(e.target.value)} className='form-control'/> <label>{base}</label>
						{
							loading ? <div>Loading .... </div> :
							<div className='overflow-x-auto'>
								<table className='table table-zebra w-full'>
								<thead>
									<tr>
										<th>Currency</th>
										<th>We Buy</th>
										<th>Exchange Rate</th>
										<th>We Sell</th>
									</tr>
								</thead>
								<tbody>
									<tr>
										<td>CAD</td>
										<td>{currencies.CAD}</td>
										<td>{currencies.CAD}</td>
										<td></td>
									</tr>
									<tr>
										<td>IDR</td>
										<td></td>
										<td>{currencies.IDR}</td>
										<td></td>
									</tr>
									<tr>
										<td>JPY</td>
										<td></td>
										<td>{currencies.JPY}</td>
										<td></td>
									</tr>
									<tr>
										<td>CHF</td>
										<td></td>
										<td>{currencies.CHF}</td>
										<td></td>
									</tr>
									<tr>
										<td>EUR</td>
										<td></td>
										<td>{currencies.EUR}</td>
										<td></td>
									</tr>
									<tr>
										<td>GBP</td>
										<td></td>
										<td>{currencies.GBP}</td>
										<td></td>
									</tr>
								</tbody>
							</table>
							</div>

						}
					</div>
				</div>
			</div>
		</div>
	);
}

export default App;
